import React from 'react'

const SearchItem = ({user: {firstName, lastName, email}}) => {
  return (
    <li className='collection-item'>
      <div className="flex">
        <img
          src='user-img'
          alt={<i className='fas fa-user-circle' />}
        />
      </div>
      <div>
        <span>{firstName} {lastName}</span>
        <br/>
        <span>{email}</span>
      </div>
    </li>
  )
}

export default SearchItem;



